<!DOCTYPE html>
<html>
<head>
  <title>Leaflet mobile example</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
  <link rel="stylesheet" href="http://cdn.leafletjs.com/leaflet/v0.7.7/leaflet.css" />
  <script src="http://cdn.leafletjs.com/leaflet/v0.7.7/leaflet.js"></script>

  <style>
    body {
      padding: 0;
      margin: 0;
    }
    html, body, #map {
		height: 90vh !important;
    }
  </style>
</head>
<body>
  <div id="map"></div>

  <script>
  
	var currentLocationIcon = 'data:image/png;base64,';
    
	var selectedLocationIcon = 'data:image/png;base64,';
	
	
	var pharmacyIcon = 'data:image/png;base64,';
	
	navigator.geolocation.getCurrentPosition( function(location) {
	
		var latlng = new L.LatLng(location.coords.latitude, location.coords.longitude);

		var mymap = L.map('map').locate({setView: true, maxZoom: 13}).fitWorld();
	
		L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
			maxZoom: 18,
			tileSize: 512,
			zoomOffset: -1
		}).addTo(mymap);
		
		
		// add custom icon for location
		var currentLocation = L.icon({
			iconUrl: currentLocationIcon,
			iconSize: [25, 25],
			className: 'blinking'
		});
		L.marker(latlng, { icon: currentLocation }).addTo(mymap).bindPopup("<b>Current Location</b><br />" + "<b>lat: </b>" + latlng.lat + "<br /> <b>Long: </b>" + latlng.lng).openPopup();


		
		
		
		
		// plot data from database
		var plotDatabaseLayerGroup = L.layerGroup().addTo(mymap);
		var data = <?php echo json_encode($myArray); ?>;
		plotDatabaseLayerGroup.clearLayers();
		
		for (var i = 0; i < data.length; i++) {
		
			if( data[i].map_category = "pharmacy") {
			
				var latlng = new L.LatLng(data[i].map_lat, data[i].map_lng);
				var pharmacyIconResize = L.icon({
					iconUrl: pharmacyIcon,
					iconSize: [32, 32]
				});
				L.marker(latlng, { icon: pharmacyIconResize }).addTo(plotDatabaseLayerGroup).bindPopup("<b>" + data[i].map_name + "</b><br />" + data[i].map_desc).openPopup();
			
			} else {
				
				var latlng = new L.LatLng(data[i].map_lat, data[i].map_lng);
				var currentLocation = L.icon({
					iconUrl: currentLocationIcon,
					iconSize: [32, 32]
				});
				L.marker(latlng, { icon: currentLocation }).addTo(plotDatabaseLayerGroup).bindPopup("<b>" + data[i].map_name + "</b><br />" + data[i].map_desc).openPopup();
				
			}
		}
		
	
		
	});
  </script>
</body>
</html> 